import React from 'react'
import { MovieState } from "../Context/MovieContext";
import Hero from '../components/Hero/Hero';
import '../App.css';

const AllMovies = () => {
  return (
    <MovieState>
      <h1>AllMovies</h1>
      <Hero />
    </MovieState>
  );
};

export default AllMovies;
